(1, '2023-06-05 17:43:03.204', '2023-06-19 15:05:50.124', '2023-06-19 15:05:50.125', '少帅，夫人说她不配', 1, '逆袭', '世间灵骨，共分四品。 一品，天灵骨。二品，金灵骨。三品，玄灵骨。四品，白灵骨。 余者，皆为凡骨，无缘修行。 一介凡骨许太平，誓要向这修行界证明，凡骨亦能斩妖', 2214, 1, 0, 84, 'cover.png', 'http://playlet-aa.oss-ap-southeast-1.aliyuncs.com/shaotabupei', '2023-06-04 00:00:00.000', 5, 1, 1, 4, 0),
(2, '2023-06-05 17:44:31.661', '2023-06-19 15:05:50.124', '2023-06-19 15:05:50.125', '神豪保安', 3, '神豪', '毕业酒席上，父母兄弟惨死，遭遇追杀，侥幸逃生，昆仑山上习武五年，我强势归来！ 　　“你是顶尖阔少，我惹不起你？我师父一巴掌可以拍死！” 　　“你是中医之王？我师父乃鬼门传人，十三针定天下人生死！” 　　“你是宗师武者，一人之下，万人之上？我师父坐镇昆仑，天下宗师来拜！” 　　“你是江南王，权倾天下？我师父曾为帝师，是你上司的上司！” 　　“你亿万家产，左右世界金', 3116, 0, 0, 154, 'cover.png', 'http://playlet-aa.oss-ap-southeast-1.aliyuncs.com/shenhaobaoan', '2023-06-05 17:43:03.224', 3, 1, 1, 4, 0),
(3, '2023-06-05 17:47:15.133', '2023-06-19 15:05:50.124', '2023-06-19 15:05:50.125', '神医狂婿', 5, '神医', '一本以长生者视角跨越几个修仙大时代的长生文，从平凡小山村走出小界域，跨入修仙大世，经历修仙界蓬勃发展时代、黄金鼎盛时代、规则崩灭时代，黑暗大动乱时代', 7940, 1, 0, 42, 'cover.png', 'http://rvrwh3ioy.sabkt.gdipper.com/shenyikx', '2023-06-05 17:44:31.674', 7, 1, 1, 4, NULL),
(4, '2023-06-05 17:49:05.510', '2023-06-19 15:05:50.124', '2023-06-19 15:05:50.125', '蚀骨情深', 9, '暧昧', '林舒发现自己怀孕的那天，还没来得及告诉唐亦琛，就收到了离婚协议书。 她强忍心脏的疼痛，潇洒转身离开。', 2351, 1, 0, 78, 'cover.png', 'http://rvrwh3ioy.sabkt.gdipper.com/shiguqingshen', '2023-06-05 17:47:15.146', 5, 1, 1, 4, NULL),
